import React from 'react';
import { Link } from 'react-router-dom'; // Assuming you are using react-router for navigation
import Footer from '../components/Footer'; // Import your Footer component
import LiveMatches from '../components/LiveMatches';
import UpcomingMatches from '../components/UpcomingMatches';

const Dashboard = () => {
  return (
    <div className="flex flex-col min-h-screen bg-gray-100 overflow-y-auto max-h-screen">
      {/* Header Section */}
      <header className="bg-indigo-600 text-white py-10">
        <h1 className="text-4xl font-bold text-center text-white libre-baskerville-bold">Dashboard</h1>
        <p className="text-center mt-2 tinos-regular text-lg">
          This page is currently in development. Please explore other sections of the website.
        </p>
      </header>

      <section >
        <LiveMatches/>
        <UpcomingMatches/>
      </section>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default Dashboard;
